import classes from "./Header.module.css";
import mainImage from "../../../assets/meals.jpg";

const Header = () => {
	return (
		<>
			<header className={classes.header}>
				<h1>ReactMeals</h1>
				<button>Cart</button>
			</header>

			<img className={classes["main-image"]} src={mainImage} />
		</>
	);
};

export default Header;
